class BaseUsersController < ApplicationController
  require 'basecrm'
  require 'httparty'
  require 'json'
  before_action :set_base_user, only: [:show, :edit, :update, :destroy]

  # GET /base_users
  # GET /base_users.json
  def index
    @base_users = BaseUser.all
  end

  # GET /base_users/1
  # GET /base_users/1.json
  def show
  end

  # GET /base_users/new
  def new
    @base_user = BaseUser.new
  end

  # GET /base_users/1/edit
  def edit
  end

  # POST /base_users
  # POST /base_users.json
  def create
    @base_user = BaseUser.new(base_user_params)

    respond_to do |format|
      if @base_user.save
        format.html { redirect_to @base_user, notice: 'Base user was successfully created.' }
        format.json { render :show, status: :created, location: @base_user }
      else
        format.html { render :new }
        format.json { render json: @base_user.errors, status: :unprocessable_entity }
      end
    end
  end

  # PATCH/PUT /base_users/1
  # PATCH/PUT /base_users/1.json
  def update
    respond_to do |format|
      if @base_user.update(base_user_params)
        format.html { redirect_to @base_user, notice: 'Base user was successfully updated.' }
        format.json { render :show, status: :ok, location: @base_user }
      else
        format.html { render :edit }
        format.json { render json: @base_user.errors, status: :unprocessable_entity }
      end
    end
  end

  # DELETE /base_users/1
  # DELETE /base_users/1.json
  def destroy
    @base_user.destroy
    respond_to do |format|
      format.html { redirect_to base_users_url, notice: 'Base user was successfully destroyed.' }
      format.json { head :no_content }
    end
  end

  def get_all_users
    client = BaseCRM::Client.new(access_token: "#{ENV['ACCESS_TOKEN']}")
    users = []
    thirty_day_notes = []
    sixty_day_notes = []
    iterating = true
    page = 1
    while iterating do
      notes = HTTParty.get("https://api.getbase.com/v2/notes?page=#{page}&per_page=100", :headers => {"Accept" => "application/json", "Authorization" => "Bearer e33471b597454cf865278806dd50e854a700b98fa5ef8efec5be01cc532d094e", "User-Agent" => "Httparty"})
      if notes['items'] == nil || notes['items'] == []
        iterating = false 
      else
        notes['items'].each do |note|
          if note['data']['created_at'] > (Time.now - 30.days)
            thirty_day_notes << note['data']['resource_id']
          elsif note['data']['created_at'] > (Time.now - 60.days)
            sixty_day_notes << note['data']['resource_id']
          else
          end
        end
        page += 1
      end
    end
    thirty_day_notes.uniq.each do |user_id|
      @base_record = client.contacts.find(user_id)
      @user = BaseUser.create(id: user_id, name: @base_record.name, role: @base_record.title)
    end
    sixty_day_notes.uniq.each do |user_id|
      if BaseUser.find_by_id(user_id) == nil 
        @base_record = client.contacts.find(user_id)
        @user = BaseUser.create(id: user_id, name: @base_record.name, role: @base_record.title)
      end      
    end
    thirty_day_notes.each do |user_id|
      if BaseUser.find_by_id(user_id) != nil
        @user = BaseUser.find_by_id(user_id)
        new_engagement = @user.current_month_engagement + 1
        @user.update_attributes(current_month_engagement: new_engagement)
        @user.save
      end
    end
    sixty_day_notes.each do |user_id|
      if BaseUser.find_by_id(user_id) != nil
        @user = BaseUser.find_by_id(user_id)
        new_engagement = @user.previous_month_engagement + 1
        @user.update_attributes(previous_month_engagement: new_engagement)
      end
    end
    max_thirty_day_notes = BaseUser.order("current_month_engagement DESC")[2].current_month_engagement
    max_sixty_day_notes = BaseUser.order("previous_month_engagement DESC")[2].previous_month_engagement
    BaseUser.all.each do |user|
      current_month_engagement_score = get_thirty_day_user_engagement_score(user.current_month_engagement, max_thirty_day_notes)
      previous_month_engagement_score = get_sixty_day_user_engagement_score(user.current_month_engagement, max_sixty_day_notes)
      user.update_attributes(current_month_engagement_score: current_month_engagement_score, previous_month_engagement_score: previous_month_engagement_score)
    end
    # puts "made it past the engagement scores"*100
    # post back to base
    # BaseUser.all.each do |user|
    #   post_engagement_score_to_base(user)
    # end
    redirect_to '/'
  end

  def get_thirty_day_user_engagement_score(thirty_day_notes, thirty_day_max_notes) 
    return ((thirty_day_notes.to_f/thirty_day_max_notes.to_f)*5)
  end

  def get_sixty_day_user_engagement_score(sixty_day_notes, sixty_day_max_notes) 
    return ((sixty_day_notes.to_f/sixty_day_max_notes.to_f)*5)
  end

  def post_engagement_score_to_base #(user) <- set to take a BaseUser obejct
    body = '{
          "data": {
          "customer_status": "current",
          "tags": [
            "baller",
            "early-adopter"
            ],
            "custom_fields": {
              "LO Score Test 7" => "101"
            }
          }
        }'
    headers = {
      "Accept" => "application/json",
      "Content-Type" => "application/json",
      "Authorization" => "Bearer e33471b597454cf865278806dd50e854a700b98fa5ef8efec5be01cc532d094e",
      "User-Agent" => "Httparty",
      "/data" => {
          "data": {
          "customer_status": "current",
          "tags": [
            "baller",
            "early-adopter"
            ],
            "custom_fields": {
              "LO Score Test 7" => "101"
            }
          }
        }
    }
    response = HTTParty.put("https://api.getbase.com/v2/contacts/120845285", :headers => headers, :payload => body)
    puts "_"*100
    puts response
    puts "_"*100
    redirect_to '/'
  end

  def delete_all_base_users
    @users = BaseUser.all 
    @users.destroy_all
    redirect_to '/'
  end

  private
    # Use callbacks to share common setup or constraints between actions.
    def set_base_user
      @base_user = BaseUser.find(params[:id])
    end

  end

